package swa.manage.entity;import swa.manage.value.TimePeriodEnum;import swa.manage.value.ValidEnum;import java.io.Serializable;import java.util.Date;/** * RoomRecord:会议室预定记录表 * Created by jinyan.cao on 2017-07-03 17:47:53 */public class RoomRecord implements Serializable {    private static final long serialVersionUID = 2638601471608719819L;    /**     * 自增主键     */    private Long id;    /**     * 预定日期     */    private Date date;    /**     * 预定时间段，如0代表00:00-00:30，1代表00:30-1:00     */    private TimePeriodEnum timePeriod;    /**     * 编码:layer-pid     */    private String encode;    /**     * 人员预定表中关联id     */    private Long staffRecordId;    /**     * 是否已定：0-未定，1-已定     */    private ValidEnum validStatus;    /**     * 创建时间     */    private Date createTime;    /**     * 更新时间     */    private Date updateTime;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public Date getDate() {        return this.date;    }    public void setDate(Date date) {        this.date = date;    }    public ValidEnum getValidStatus() {        return validStatus;    }    public void setValidStatus(ValidEnum validStatus) {        this.validStatus = validStatus;    }    public TimePeriodEnum getTimePeriod() {        return timePeriod;    }    public void setTimePeriod(TimePeriodEnum timePeriod) {        this.timePeriod = timePeriod;    }    public String getEncode() {        return this.encode;    }    public void setEncode(String encode) {        this.encode = encode;    }    public Long getStaffRecordId() {        return this.staffRecordId;    }    public void setStaffRecordId(Long staffRecordId) {        this.staffRecordId = staffRecordId;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    @Override    public String toString() {        return "RoomRecord{" +                "id=" + id + '}';    }}